func binarySearch(key int) int {
	left := 0
	right := n
	var mid int
	for left < right {
		mid = (left + right) / 2
		if key == A[mid] {
			return 1 // key found
		}
		if key > A[mid] {
			left = mid + 1 // search the second half
		} else if key < A[mid] {
