ll mod_pow(ll a, ll n, ll mod) {
  ll res = 1;
  while (n > 0) {
    if (n & 1) res = res * a % mod;
    a = a * a % mod;
    n >>= 1;
  }
  return res;
}

//a^(-1) % mod (only if : a % p != 0)                                                  
ll mod_inv(ll a, ll mod) {
  return mod_pow(a, mod - 2, mod);
}

