        q.add(new int[]{0, -1, -1});
        while (!q.isEmpty()) {
            int[] current = q.pollLast();
            int currentNode = current[0], usedColor = current[1], parentNode = current[2];
            int color = 1;
            for (int childNode : edges.get(currentNode)) {
