import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        int n = scanner.nextInt();
        Integer[] ls = new Integer[n];
        for (int i = 0; i < n; i++) {
            ls[i] = scanner.nextInt();
        }
        Integer[] lsRev = ls.clone();
        Arrays.sort(ls);
        Arrays.sort(lsRev, Collections.reverseOrder());

        int ans = 0;
        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j < n; j++) {
                int p = Math.min(ls[i], ls[j]);
                int q = Math.max(ls[i], ls[j]);
                int x = q - p;
                int y = q + p;

                int l = Arrays.binarySearch(ls, x);
                if (l < 0) l = -(l + 1);
                int r = Arrays.binarySearch(lsRev, y, Collections.reverseOrder());
                if (r < 0) r = n - (-(r + 1));

                int sum = r - l;
                if (i >= l && i <= r) {
                    sum--;
                }
                if (j >= l && j <= r) {
                    sum--;
                }
                sum = Math.max(0, sum);
                ans += sum;
            }
        }

        ans /= 3;
        System.out.println(ans);
    }
}

