func put(m map[Pair]int, p Pair) {
	if _, ok := m[p]; ok {
		m[p]++
	} else {
		m[p] = 1
	}
}

func rem(m map[Pair]int, p Pair) {
	if m[p] == 1 {
		delete(m, p)
	} else {
		m[p]--
	}
}

func firstKey(m map[Pair]int) Pair {
	var first Pair
	for k := range m {
		first = k
		break
	}
	return first
}

