vector<int> perm_sub(vector<int> li, set<int> used) {
    if (li.size() == used.size()) {
        return vector<int>();
    }
    vector<int> k;
    for (int i = 0; i < li.size(); i++) {
        if (used.find(i) != used.end()) {
            continue;
        }
        used.insert(i);
        vector<int> sub_list = perm_sub(li, used);
        for (auto &sub : sub_list) {
            sub.insert(sub.begin(), li[i]);
        }
        k.insert(k.end(), sub_list.begin(), sub_list.end());
        used.erase(i);
    }
    return k;
}

vector<int> perm_li(vector<int> li) {
    return perm_sub(li, set<int>());
}

vector<int> perm_n(int n) {
    vector<int> li(n);
    iota(li.begin(), li.end(), 0);
    return perm_sub(li, set<int>());
}

string join_i(vector<int> li, string sep="") {
