vector<int> prime_list(int n) {
    vector<int> li(n-1);
    iota(li.begin(), li.end(), 2);
    for (int i = 0; i < li.size(); i++) {
        if (li[i] >= sqrt(n)) {
            break;
        }
        if (li[i] == -1) {
            continue;
        }
        for (int j = i+1; j < li.size(); j++) {
            if (li[j] % li[i] == 0) {
                li[j] = -1;
            }
        }
    }
    li.erase(remove(li.begin(), li.end(), -1), li.end());
    return li;
}

int gcd(int a, int b) {
    if (b > a) {
        swap(a, b);
    }
    while (true) {
        int r = a % b;
        if (r == 0) return b;
        a = b;
        b = r;
    }
}

int lcm(int a, int b) {
    return a * b / gcd(a, b);
}

vector<set<int>> all_subset(vector<int> li) {
    vector<set<int>> s;
    int n = li.size();
    for (int bit = 0; bit < (1 << (n+1)); bit++) {
        set<int> ss;
        for (int i = 0; i < n; i++) {
            if (bit & (1 << i)) {
                ss.insert(li[i]);
            }
        }
        s.push_back(ss);
    }
    return s;
}

int factorial(int n) {
    if (n == 1) {
        return 1;
    }
    return n * factorial(n-1);
}

int mCn(int m, int n) {
    int r = 1;
    while (n) {
        r *= m;
        m -= 1;
        n -= 1;
    }
    return r / factorial(n);
}

