func solve() {
	scanner := bufio.NewScanner(os.Stdin)
	scanner.Scan()
	params := strings.Split(scanner.Text(), " ")
	N, _ := strconv.Atoi(params[0])
	K, _ := strconv.Atoi(params[1])

	scanner.Scan()
	A := make([]int, N)
	for i, a := range strings.Split(scanner.Text(), " ") {
		A[i], _ = strconv.Atoi(a)
		A[i] = A[i]%K - 1
	}

	sum_A := make([]int, N+1)
	count := 0
	modK := make(map[int][]int)
	modK[0] = []int{0}

	for i := 0; i < N; i++ {
		sum_A[i+1] = (sum_A[i] + A[i]) % K
		if _, ok := modK[sum_A[i+1]]; !ok {
			modK[sum_A[i+1]] = []int{i + 1}
		} else {
			modK[sum_A[i+1]] = append(modK[sum_A[i+1]], i+1)
		}
	}

	for _, v := range modK {
		lenK := len(v)
		for i, a := range v {
			count += bisectLeft(v, a+K, i, lenK) - i - 1
		}
	}

	fmt.Println(count)
}

func bisectLeft(a []int, x int, lo int, hi int) int {
	for lo < hi {
		mid := (lo + hi) / 2
		if a[mid] < x {
			lo = mid + 1
		} else {
			hi = mid
		}
	}
	return lo
}
