        for (int i = 0; i < N; i++) {
            A[i] = scanner.nextInt() / 2;
        }
        scanner.close();

        int countDiv2 = -1;
        for (int a : A) {
            int cnt = 0;
            while (a % 2 == 0) {
                a /= 2;
                cnt++;
            }
            if (countDiv2 == -1) {
                countDiv2 = cnt;
            } else if (cnt != countDiv2) {
                System.out.println(0);
                return;
            }
        }

        long myLcm = lcmList(A);
        if (myLcm > M) {
            System.out.println(0);
            return;
        }

        long tmp = M / myLcm;
        long ans = (tmp + 1) / 2;
        System.out.println(ans);
    }

    private static long lcm(long a, long b) {
        return a / gcd(a, b) * b;
    }

    private static long lcmList(int[] numbers) {
        long lcm = 1;
        for (int number : numbers) {
            lcm = lcm(lcm, number);
        }
        return lcm;
    }

    private static long gcd(long a, long b) {
        if (b == 0) {
            return a;
        } else {
            return gcd(b, a % b);
        }
    }
}

